ISLAMABAD, Jan 12 (APP): Minister for Water Resources Chaudhry Moonis Elahi and Minister for Industries and Production Makhdoom Khusro Bakhtiar called on Prime Minister Imran Khan here on Wednesday.
Besides political situation in the country, matters relating to strong relations and mutual cooperation between the government and allied parties were discussed in the meeting.
